import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import CampaignPage from './pages/CampaignPage';
import DashboardPage from './pages/DashboardPage';
import DisparoPage from './pages/DisparoPage';
import HistoryPage from './pages/HistoryPage';
import SuggestionPage from './pages/SuggestionPage';
import TemplatePage from './pages/TemplatePage';
import UploadPage from './pages/UploadPage';

import JourneysPage from './pages/JourneysPage';
import JourneyBuilder from './pages/JourneyBuilder';
import TemplatesCompliancePage from './pages/TemplatesCompliancePage';


const App = () => {
  return (
    <BrowserRouter>
      <div style={{ display: 'flex' }}>
        <nav>
          <a href="/upload">Upload Base</a>
          <a href="/disparo">Disparar Campanha</a>
          <a href="/template">Criar Template</a>
          <a href="/historico">Histórico</a>
          <a href="/dashboard">Dashboard</a>
          <a href="/sugestoes">Sugestões de IA</a>
          <a href="/journeys">Journeys</a>
          <a href="/journeys/builder">Builder</a>
          <a href="/templates/compliance">Template Compliance</a>
        </nav>
        <div style={{ marginLeft: '180px', padding: '2rem', width: '100%' }}>
          <Routes>
            <Route path="/upload" element={<UploadPage />} />
            <Route path="/disparo" element={<DisparoPage />} />
            <Route path="/template" element={<TemplatePage />} />
            <Route path="/historico" element={<HistoryPage />} />
            <Route path="/dashboard" element={<DashboardPage />} />
            <Route path="/sugestoes" element={<SuggestionPage />} />
            <Route path="/campanha" element={<CampaignPage />} />
          </Routes>
        </div>
      </div>
    </BrowserRouter>
  );
};

export default App;
